import { useDispatch } from "react-redux";

function Main() {
  const dispatch = useDispatch();
  const number = 0;
  return (
    <div>
      <button onClick={() => dispatch(decCount())}>-</button>
      <button onClick={() => dispatch(changeCount(number))}>{number}</button>
      <button onClick={() => dispatch(incCount())}>+</button>
    </div>
  );
}
